import java.util.*;
import java.io.*;

public class Solution {

    public static void main(String[] args) {

        Scanner dir = new Scanner(System.in);
        String directory = dir.next();

        int num_files = 5;

        File[] files = new File[num_files];
        File[] output_files = new File[num_files];

        double overall_score =0;
        int[] testcase_status = new int[5];
        double[] testcase_score = new double[5];
        for(int i=0;i<5;i++) {
            testcase_status[i] = 0;
            testcase_score[i] = 0;
        }

        try {
        for(int i=0;i<num_files;i++){
            String input = directory +"/input"+"0000"+i + ".in";
            String output = directory+"/output"+"0000"+i + ".out";
            files[i]=new File(input);
            output_files[i] = new File(output);
        }

        for(int i=0;i<files.length;i++){
            double profit = createTSPChecker(files[i], output_files[i]);

            double weighted_score=0;
            if(profit>0){
                testcase_status[i] = 1;
                weighted_score = weightedScore(profit, i);
            }
            testcase_score[i] = profit;

            overall_score += weighted_score;

        }
        }catch (Exception e)
        {
        }

        System.out.println(overall_score/250);
        System.out.format("%d %d %d %d %d\n", testcase_status[0], testcase_status[1],testcase_status[2],testcase_status[3],testcase_status[4]);
        System.out.format("%f %f %f %f %f\n", testcase_score[0], testcase_score[1],testcase_score[2],testcase_score[3],testcase_score[4]);
    }

    public static double weightedScore(double score, int i)
    {
                int[] weights = {1, 2, 10, 20, 217};
                int[] max_scores = {300,30000,900000,100000000,1000000000};

                double weighted_score = weights[i] * score / max_scores[i];
                return weighted_score;
    }


    public static double createTSPChecker(File f, File out)
    {
        ArrayList<City> city_array = new ArrayList<City>();

        HashMap<City, Integer> cities = new HashMap<City, Integer>();

        try {
            Scanner scan = new Scanner(f);

            int LINES = scan.nextInt();
            float widget_multiple = scan.nextFloat();
            float price_factor = scan.nextFloat();

            for(int i=0;i<LINES;i++){
                City city = new City(scan.nextInt(), scan.nextInt(), scan.nextInt());

                city_array.add(city);

                cities.put(city, city.initial_widget_value);

            }

            TSPCheck tsp1 = new TSPCheck(city_array, cities, widget_multiple, price_factor, out);
            return tsp1.getTotalProfit();

        } catch (FileNotFoundException e) {
            return 0;
        }
    }
}




class City {

    int x, y, initial_widget_value;


    boolean visited;

    public City(int x, int y, int initial_widget_value)
    {
        this.x = x;
        this.y = y;
        this.initial_widget_value = initial_widget_value;
    }

    public City(int x, int y)
    {
        this.x = x;
        this.y = y;
    }

    public int x()
    {
        return x;
    }

    public int y()
    {
        return y;
    }

    public int initial_widget_value()
    {
        return initial_widget_value;
    }


    @Override
    public int hashCode() {
        final int prime = 31;
        int result = 1;
        result = prime * result + x;
        result = prime * result + y;
        return result;
    }

    @Override
    public boolean equals(Object obj) {
        if (this == obj)
            return true;
        if (obj == null)
            return false;
        if (getClass() != obj.getClass())
            return false;
        City other = (City) obj;
        if (x != other.x)
            return false;
        if (y != other.y)
            return false;
        return true;
    }






}








class TSPCheck {
    HashMap<City, Integer> cities;

    float widget_multiple;
    float decline;

    double total_profit = 0;

    int city_visits=0;

    int NUM_CITIES;

    City hq = new City(0,0);

    public TSPCheck(ArrayList<City> city_array, HashMap<City, Integer> cities, float widget_multiple, float decline, File out) {

        this.widget_multiple = widget_multiple;
        this.decline = decline;
        this.cities = cities;

        NUM_CITIES = cities.size();

        getInput(out);
    }


    public void getInput(File user_output){

        City previous_city = hq;

        int widgets=0;

        Scanner scanline;
        try {
            scanline = new Scanner(user_output);

            while(scanline.hasNextLine()){

                String line = scanline.nextLine();
                Scanner scan = new Scanner(line);

                if(!scan.hasNextInt()){
                    runError();
                    break;
                }

                City city = new City(scan.nextInt(), scan.nextInt() );

                if(isHQ(previous_city)){
                    if(!scan.hasNextInt()){
                        runError();
                        break;
                    }
                    widgets = scan.nextInt();
                }

                if(isHQ(city)){
                    double distance = getDistance(previous_city, city);
                    total_profit -= distance;
                    previous_city = city;

                }


                else if(cities.containsKey(city)){

                    city.initial_widget_value = cities.get(city);

                    if(widgets<=0){
                        runError();
                        break;
                    }

                    double current_widget_value = getCurrentWidgetValue(city.initial_widget_value() );

                    double distance = getDistance(previous_city, city);
                    double leg_cost = getLegCost(distance, widgets);

                    double leg_profit = current_widget_value - leg_cost;
                    total_profit += leg_profit;

                    cities.remove(city);

                    previous_city = city;

                    widgets--;
                    city_visits++;
                }
                else{
                    runError();
                    break;
                }

            }

        } catch (FileNotFoundException e) {
            runError();
            return;
        }

    }

    private boolean isHQ(City city)
    {
        return city.equals(hq);
    }

    private double getLegCost(double distance, int widgets) {
        double widgets_cost = distance *  widget_multiple * widgets;
        return widgets_cost + distance;
    }

    private double getCurrentWidgetValue(int initial_widget_value) {
        int exponent = 10 * city_visits / NUM_CITIES;

        double current_value = initial_widget_value * Math.pow(decline, exponent);

        return current_value;
    }


    private double getDistance(City prev_city, City curr_city)
    {
        int diffx = prev_city.x() - curr_city.x();
        int diffy = prev_city.y() - curr_city.y();
        double distance = Math.hypot(diffx, diffy);
        return distance;
    }

    private void runError()
    {
        total_profit = 0;
    }


    public double getTotalProfit() {
        return total_profit;
    }
}
